export function splitIntoDigits (value)
{
    return {
        d0:  Math.floor (value % 10) ^ 0,
        d1: (Math.floor (value / 10) % 10) ^ 0,
        d2: (Math.floor (value / 100) % 10) ^ 0
    };
}

export function combineDigits (digits)
{
    return Math.floor (digits.d0)
        + (Math.floor (digits.d1) * 10)
        + (Math.floor (digits.d2) * 100);
}

export function getIDOfIndex (index)
{
    const digits = { d0: 1 + (index & 7),
                     d1: 1 + ((index >> 3) & 7),
                     d2: 1 + ((index >> 6) & 7) };

    return combineDigits (digits);
}

export function getIndexOfID (id)
{
    let digits = splitIntoDigits (id);

    return (digits.d0 - 1)
         + ((digits.d1 - 1) * 8)
         + ((digits.d2 - 1) * 64);
}

export function getIDWithNewDigit (oldID, digitIndex, newDigit)
{
    let digits = splitIntoDigits (oldID);

    if (digitIndex == 0)
        digits.d0 = newDigit;
    else if (digitIndex == 1)
        digits.d1 = newDigit;
    else
        digits.d2 = newDigit;

    return combineDigits (digits);
}

